import React,{Component} from 'react'
import PropTypes from 'prop-types';

class TodoItem extends Component{
    constructor(props){
        super(props)
    }

    doDel=()=>{
        console.log('do del');
        console.log(this.props.keyindex);
        this.props.itemDel(this.props.keyindex)
    }

    render(){
        console.log('TodoItem render :' + this.props.keyindex);
        return <li onClick={this.doDel}>
            {this.props.keyindex+' '} 
            {this.props.val}
            </li>
    }
}

export default TodoItem
